import React, { useEffect, useState } from 'react';
import Box from '@mui/material/Box';
import Grid from '@mui/material/Grid';
import TextField  from '@mui/material/TextField';
import Button from '@mui/material/Button/Button';
import TableContainer from '@mui/material/TableContainer/TableContainer';
import TableHead from '@mui/material/TableHead/TableHead';
import TableCell from '@mui/material/TableCell/TableCell';
import TableRow from '@mui/material/TableRow/TableRow';
import TableBody from '@mui/material/TableBody/TableBody';
import Table from '@mui/material/Table/Table';
import Paper from '@mui/material/Paper/Paper';
import Container from '@mui/material/Container/Container';

interface ApiInfo {
  name: string;
  version: string;
  definition_url: string;
}

export default function Home() {
  const [size, setSize] = useState<String>("25")
  const [isLoaded, setIsLoaded] = useState<Boolean>(false)
  const [values, setValues] = useState<ApiInfo[]>([]) 

  useEffect(()=>{
    fetch(
      '/apis/' + size,
      {
      method :"GET",
      mode: "no-cors",
      headers : {
        'Content-Type':'application/json',
        'Accept': 'application/json',
        "Access-Control-Allow-Origin": "*",
      },
      }
    )
    .then(response => response.json())
    .then(data => setValues(data["apis_info"]))
    .catch(error => console.log(error))
  },[isLoaded])

  return (
    <Container maxWidth="sm">
      <Box>
        <Grid container spacing={2}>
          <Grid item xs={8}>
            <TextField 
              id="outlined-basic" 
              label="Data size"
              variant="outlined"
              value={size} 
              onChange={(e)=>{setSize(e.target.value)}}/>
          </Grid>
          <Grid item xs={4}>
            <Button 
              variant="contained"
              onClick={()=> setIsLoaded(!isLoaded)}
            >
              Load
            </Button>
          </Grid>
          <Grid item xs={6}>
              <TableContainer component={Paper}>
                <Table sx={{ minWidth: 650 }} aria-label="simple table">
                  <TableHead>
                    <TableRow>
                      <TableCell>API Names</TableCell>
                    </TableRow>
                  </TableHead>
                  <TableBody>
                    {values.map((row) => (
                      <TableRow
                        key={row? row["name"] + row["version"]: "qdsfq"}
                        sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
                      >
                        <TableCell 
                          component="th" 
                          scope="row"
                        > 
                          {row} 
                        </TableCell>
                      </TableRow>
                    ))}
                  </TableBody>
                </Table>
        </TableContainer>
          </Grid>
          <Grid item xs={6}>
            <div>API definition</div>          
            <Paper variant="outlined">This is a definition</Paper>
          </Grid>
        </Grid>
      </Box>
    </Container>
  );
}
